    def prime_check(n: int) -> bool:
        if n == 1:
            return True
        for i in range(2, int(sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True
    count = 0
    while x > 0 and x % d == 0:
        count += 1
        x //= d
    if count > 1 and (not prime_check(x)):
        return 'YES'
    elif count > 2 and (not prime_check(d)):
        result = False
        i = 2
        while i <= int(sqrt(d)):
            if d % i == 0:
                if x * i % d:
                    result = True
                    break
                else:
                    if x * i % d:
                        result = True
                        break
                    if x * (d // i) % d:
                        result = True
                        break
            i += 2
        if result or count > 3:
            return 'YES'
        else:
            return 'NO'
    else:
        return 'NO'

